        System.out.println(wildcardMatch("17625908604", "17625908604"));
        System.out.println(wildcardMatch("17625*08604", "17625?08604"));
        System.out.println(wildcardMatch("17625*08604", "17625???604"));
        System.out.println(wildcardMatch("17625*08604", "17625***604"));
