    private static void runMatch(List<String> elements) {
        //字符串去重
        Set<String> distinctElements = Sets.newLinkedHashSet(elements);

        //Key不包含*, ?字符串(Key: 去重字符串 Value: 重复数量)
        Map<String, Integer> specificMap = Maps.newHashMap();
        //Key包含*, ?字符串(Key: 去重字符串 Value: 重复数量)
        Map<String, Integer> wildcardMap = Maps.newHashMap();
        for (String element : elements) {
            if (element.contains("*") || element.contains("?")) {
                Integer count = wildcardMap.get(element);
                wildcardMap.put(element, count == null ? 1 : count + 1);
            } else {
                Integer count = specificMap.get(element);
                specificMap.put(element, count == null ? 1 : count + 1);
            }
        }

        Multimap<String, String> matchMap = HashMultimap.create();

        //所有的字符串匹配数量统计，排序结果 Key: 去重字符串 Value: 重复数量
        Map<String, Integer> statisticsMap = Maps.newLinkedHashMap();
        for (String distinctElement : distinctElements) {
            //1)精确匹配的数量
            Integer specificCount = specificMap.get(distinctElement);
            specificCount = specificCount == null ? 0 : specificCount;
            matchMap.put(distinctElement, distinctElement);//TODO remove
            //2)通配匹配的数量
            Integer wildcardCount = 0;
            //2.1)如果该字符本身包含通配符，则匹配所有的specific element
            if (distinctElement.contains("*") || distinctElement.contains("?")) {
                for (Map.Entry<String, Integer> entry : specificMap.entrySet()) {
                    String specificElement = entry.getKey();
                    if (wildcardMatch(distinctElement, specificElement)) {
                        wildcardCount += entry.getValue();
                    }
                    matchMap.put(distinctElement, specificElement);//TODO remove
                }
            }
            //2.2)通配符匹配
            for (Map.Entry<String, Integer> entry : wildcardMap.entrySet()) {
                String pattern = entry.getKey();
                if (wildcardMatch(pattern, distinctElement)
                        || wildcardMatch(distinctElement, pattern)) {
                    wildcardCount += entry.getValue();
                }
                matchMap.put(distinctElement, pattern);//TODO remove
            }
            statisticsMap.put(distinctElement, specificCount + wildcardCount);
        }

        statisticsMap.forEach((element, count) -> {
            if (count > 5) {
                System.err.println(element + " : " + count);
            }
        });
        System.err.println();
        /*
        statisticsMap.forEach((element, count) ->
                System.err.println(element + " : " + count));

        System.out.println("*******************************");

        Multiset<String> matchedKeys = matchMap.keys();
        for (String matchedKey : matchedKeys) {
            System.err.println(matchedKey + " : " + matchMap.get(matchedKey));
        }*/
    }

    /**
     * 给定字符串pattern，查找specificElements列表中是否存在与pattern匹配的字符串
     *
     * @param specificElements 匹配的字符串列表，列表所有的数据不包含通配符(最好去重)
     * @param pattern          匹配字符串模式，可能包含等通配符(*, ?)
     */
    public static boolean wildcardMatch(Collection<String> specificElements, String pattern) {
        if (isWildcardString(pattern)) {
            for (String specificElement : specificElements) {
                if (wildcardMatch(pattern, specificElement)) {
                    return true;
                }
            }
        } else {
            return specificElements.contains(pattern);
        }
        return false;
    }

    private static boolean isWildcardString(String element) {
        return element.contains("*") || element.contains("?");
    }

    /**
     * <a href='https://wdxtub.com/interview/14520604921399.html'>Wildcard Matching</a>
     *
     * @param pattern 通配符表达式
     * @param content 匹配的内容
     */
    public static boolean wildcardMatch(String pattern, String content) {
        int ii = -1, jj = -1, i = 0, j = 0;
        while (i < content.length()) {
            if (j < pattern.length() && pattern.charAt(j) == '*') {
                while (j < pattern.length() && pattern.charAt(j) == '*') ++j;
                if (j == pattern.length()) {
                    return true;
                }
                ii = i;
                jj = j;
            }
            if (j < pattern.length() && (pattern.charAt(j) == '?' || pattern.charAt(j) == content.charAt(i))) {
                ++i;
                ++j;
            } else {
                if (ii == -1) {
                    return false;
                }
                ++ii;
                i = ii;
                j = jj;
            }
        }
        while (j < pattern.length() && pattern.charAt(j) == '*') {
            ++j;
        }
        return i == content.length() && j == pattern.length();
    }

